import React, {useCallback} from 'react';
import logo from '../assets/images/logo.png'
import "../assets/css/cadastro-style.css"
import { Link } from 'react-router-dom';

function Menu(){

    var params = new URLSearchParams(window.location.search);
    var id = params.get('id');
    id = 1;

    useEffect(() => {
        async function home() {
          const resposta = await api.get("/usuarios/nome-usuario/" + id)
          setNome(resposta.data[0].nome)
          setUsuario(resposta.data[0].usuario)
        }
        buscarUsuario()
      });

    const home = useCallback(
        async(dados) => {
            alert("teste")
          dados.preventDefault();
          window.location = `https://guilherme-nascimentosantos.github.io/knowu.github.io/?id=${id}`;
        }
      )
    return(
        <>
        <header className="cadastro-header">

            <div class="logoCadastro">
                <img class="img" src={logo} alt="logo" />
            </div>

            <div class="menu">
                <a onClick={home}>Home</a>
                <a href="">Sobre nós</a>
                <a href="">Contato</a>
            </div>

            <div class="botao">
                <h1 className="menu-provisorio">Menu</h1>
                <Link to={"/login"}>
                <button class="botao-cadastro"><b>Entrar</b></button>
                </Link>
            </div>


        </header>
        </>
    )
}

export default Menu;
